"use strict";(self.webpackChunkmy_blog=self.webpackChunkmy_blog||[]).push([[3836],{4641:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"kubernetes-the-hard-way-3","metadata":{"permalink":"/en/blog/kubernetes-the-hard-way-3","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-25-kubernetes-the-hard-way-3.md","source":"@site/blog/2024-01-25-kubernetes-the-hard-way-3.md","title":"kubernetes-the-hard-way (3)","description":"https://petermd.github.io/kubernetes-the-hard-way/03-compute-resources.html","date":"2024-01-25T00:00:00.000Z","formattedDate":"January 25, 2024","tags":[{"label":"k8s","permalink":"/en/blog/tags/k-8-s"}],"readingTime":0.02,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"kubernetes-the-hard-way-3","title":"kubernetes-the-hard-way (3)","authors":"junyeong","tags":["k8s"],"hide_table_of_contents":false},"unlisted":false,"nextItem":{"title":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","permalink":"/en/blog/macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30"}},"content":"https://petermd.github.io/kubernetes-the-hard-way/03-compute-resources.html\\n\\n\\n\x3c!-- truncate --\x3e"},{"id":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","metadata":{"permalink":"/en/blog/macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-25-\ud130\ubbf8\ub110\uc5d0\uc11c-vscode-\uc2e4\ud589\ud558\uae30.md","source":"@site/blog/2024-01-25-\ud130\ubbf8\ub110\uc5d0\uc11c-vscode-\uc2e4\ud589\ud558\uae30.md","title":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","description":"window\uc5d0\uc11c\ub294 cmd\ucc3d \ud639\uc740 wsl\ud658\uacbd\uc5d0\uc11c code . \uba85\ub839\uc5b4\ub85c \uc27d\uac8c Visual Studio Code\uac00 \uc2e4\ud589\ub418\uc5c8\uc5c8\ub358 \uac83 \uac19\uc740\ub370,","date":"2024-01-25T00:00:00.000Z","formattedDate":"January 25, 2024","tags":[{"label":"tips","permalink":"/en/blog/tags/tips"}],"readingTime":0.565,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","title":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","authors":"junyeong","tags":["tips"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"kubernetes-the-hard-way (3)","permalink":"/en/blog/kubernetes-the-hard-way-3"},"nextItem":{"title":"kubernetes-the-hard-way (1)","permalink":"/en/blog/kubernetes-the-hard-way-1"}},"content":"window\uc5d0\uc11c\ub294 cmd\ucc3d \ud639\uc740 wsl\ud658\uacbd\uc5d0\uc11c `code .` \uba85\ub839\uc5b4\ub85c \uc27d\uac8c Visual Studio Code\uac00 \uc2e4\ud589\ub418\uc5c8\uc5c8\ub358 \uac83 \uac19\uc740\ub370,  \\nmacOS\uc5d0\uc11c\ub294 \ubb54\uac00 \uc798 \ub418\uc9c0 \uc54a\uc544\uc11c \ucc3e\uc544\ubcf4\ub2c8 \ub2e4\uc74c\uacfc \uac19\uc740 \uac04\ub2e8\ud55c \ud574\ubc95\uc744 \ucc3e\uc744 \uc218 \uc788\uc5c8\ub2e4.\\n\x3c!-- truncate --\x3e\\n\\n1. `Command Palette` \ub97c \uc5f4\uace0 `shell command`\ub97c \ud0c0\uc774\ud551.  \\n`Command Pallette`\ub294 `command + shift + p`\ub85c \uc5f4 \uc218 \uc788\ub2e4.\\n\\n2. \\"UnInstall \'code\' command in PATH\\" \uc120\ud0dd \uc774\ud6c4 \\"Install \'code\' command in PATH\\" \uc120\ud0dd  \\n  \\n  \\n\ub05d."},{"id":"kubernetes-the-hard-way-1","metadata":{"permalink":"/en/blog/kubernetes-the-hard-way-1","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-24-kubernetes-the-hard-way-1.md","source":"@site/blog/2024-01-24-kubernetes-the-hard-way-1.md","title":"kubernetes-the-hard-way (1)","description":"\uc544\ub798\uc640 \uac19\uc774  Google Cloud Platform SDK\ub97c \uc124\uce58\ud55c\ub2e4.","date":"2024-01-24T00:00:00.000Z","formattedDate":"January 24, 2024","tags":[{"label":"k8s","permalink":"/en/blog/tags/k-8-s"}],"readingTime":1.46,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"kubernetes-the-hard-way-1","title":"kubernetes-the-hard-way (1)","authors":"junyeong","tags":["k8s"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30","permalink":"/en/blog/macOS \ud130\ubbf8\ub110\uc5d0\uc11c VS Code \uc2e4\ud589\uc2dc\ud0a4\uae30"},"nextItem":{"title":"kubernetes-the-hard-way (2)","permalink":"/en/blog/kubernetes-the-hard-way-2"}},"content":"\uc544\ub798\uc640 \uac19\uc774  Google Cloud Platform SDK\ub97c \uc124\uce58\ud55c\ub2e4.\\n\uc790\uc138\ud55c \uc815\ubcf4\ub294 https://cloud.google.com/sdk/docs/install?hl=ko \uc5d0\uc11c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\x3c!-- truncate --\x3e\\n\\n## WSL1 - ubuntu 22.04 LTS \uae30\uc900\\n```bash\\nsudo apt-get update\\nsudo apt-get install apt-transport-https ca-certificates gnupg curl sudo\\n```\\n\\n1. Google Cloud \uacf5\uac1c\ud0a4 \uac00\uc838\uc624\uae30\\n```bash\\ncurl https://packages.cloud.google.com/apt/doc/apt-key.gpg | sudo gpg --dearmor -o /usr/share/keyrings/cloud.google.gpg\\n```\\n2. \ud328\ud0a4\uc9c0 \uc18c\uc2a4\ub85c gcloud CLI \ubc30\ud3ec URI \ucd94\uac00\\n```bash\\necho \\"deb [signed-by=/usr/share/keyrings/cloud.google.gpg] https://packages.cloud.google.com/apt cloud-sdk main\\" | sudo tee -a /etc/apt/sources.list.d/google-cloud-sdk.list\\n```\\n3. gcloud CLI \uc5c5\ub370\uc774\ud2b8 \ubc0f \uc124\uce58\\n```bash\\nsudo apt-get update && sudo apt-get install google-cloud-cli\\n```\\n4. \uc124\uce58 \ud6c4 \uc2dc\uc791\\n```bash\\ngcloud init\\n```\\n\\n## macOS \uae30\uc900\\nhttps://cloud.google.com/sdk/docs/install?hl=ko#mac\\n\uae30\ubcf8\uc801\uc73c\ub85c \uc124\uce58 \uc2a4\ud06c\ub9bd\ud2b8\uac00 \ud30c\uc774\uc36c\uc73c\ub85c \uc81c\uacf5\ub418\uae30 \ub54c\ubb38\uc5d0 \uc9c0\uc6d0\ub418\ub294 Python \ubc84\uc804(3.8~3.12)\uc774 \uc788\ub294\uc9c0 \ud655\uc778\ud55c\ub2e4.\\n\uae30\ubcf8 \uc124\uce58 \uc2a4\ud06c\ub9bd\ud2b8\ub294 CPython\uc758 Python 3.11\uc744 \uc124\uce58\ud558\ub3c4\ub85d \uc81c\uacf5.\\n1. \uc81c\uacf5\ub418\ub294 \ud328\ud0a4\uc9c0\uc911 \ud558\ub098\ub97c \ub2e4\uc6b4\ub85c\ub4dc \ud55c\ub2e4.\\n\ub098\uc758 \uacbd\uc6b0 M1\uc744 \uc0ac\uc6a9\ud558\uace0 \uc788\uae30 \ub54c\ubb38\uc5d0 ARM64\ub97c \uc120\ud0dd\\n\\n2. \ub2e4\uc6b4\ub85c\ub4dc\ub41c \ud30c\uc77c\uc744 \ud648 \ub514\ub809\ud1a0\ub9ac\ub85c \uc62e\uaca8 \uc555\ucd95\uc744 \ud47c\ub2e4.\\n\\n3. \uc544\ub798\uc758 \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc2a4\ud06c\ub9bd\ud2b8 \uc2e4\ud589\\n```bash\\n./google-cloud-sdk/install.sh\\n```\\n4. \uc124\uce58 \ud6c4 \uc2dc\uc791\\n```bash\\ngcloud init\\n```  \\n  \\n\\n\\n  \\n\\n\x3c!-- [\ub2e4\uc74c - kubernetes-the-hard-way (2)](/blog/cka/2024/01/24-02) --\x3e"},{"id":"kubernetes-the-hard-way-2","metadata":{"permalink":"/en/blog/kubernetes-the-hard-way-2","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-24-kubernetes-the-hard-way-2.md","source":"@site/blog/2024-01-24-kubernetes-the-hard-way-2.md","title":"kubernetes-the-hard-way (2)","description":"\uc900\ube44","date":"2024-01-24T00:00:00.000Z","formattedDate":"January 24, 2024","tags":[{"label":"k8s","permalink":"/en/blog/tags/k-8-s"}],"readingTime":1.8,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"kubernetes-the-hard-way-2","title":"kubernetes-the-hard-way (2)","authors":"junyeong","tags":["k8s"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"kubernetes-the-hard-way (1)","permalink":"/en/blog/kubernetes-the-hard-way-1"},"nextItem":{"title":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","permalink":"/en/blog/\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30"}},"content":"## \uc900\ube44\\n\uc6b0\uc120 `gcloud init` \uc774\uc804\uc5d0 \uad6c\uae00 \uacc4\uc815\uacfc GCP \ud504\ub85c\uc81d\ud2b8\uac00 \uc900\ube44\ub418\uc5b4\uc57c \ud55c\ub2e4.\\n\uc0c8\ub85c\uc6b4 \uacc4\uc815\uc73c\ub85c GCP\ub97c \uc2dc\uc791\ud558\uba74 90\uc77c\ub3d9\uc548 $300 \ub9cc\ud07c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc73c\ub2c8 \uc6ec\ub9cc\ud558\uba74 \uc0dd\uc131\ud574\uc11c \ud558\uc790.\\n\x3c!-- truncate --\x3e\\n\\n## SDK\ub97c \ud1b5\ud55c gcloud \uc124\uc815\\n1. \uae30\ubcf8 VM Region \ubc0f Zone \uc124\uc815\\n```bash\\ngcloud init\\ngcloud auth login\\ngcloud config set compute/region asia-northeast3    // \uc11c\uc6b8 \\ngcloud config set compute/zone asia-northeast3-a\\n```\\n2. \ud074\ub77c\uc774\uc5b8\ud2b8 \ud234 \uc124\uce58  \\n`cfssl`, `cfsslijson`, `kubectl` \uc124\uce58\\n`cfssl` \ubc0f `cfssljson`\uc740 PKI Infrastrue\uc744 \ud504\ub85c\ube44\uc800\ub2dd\ud558\uace0 TLS \uc778\uc99d\uc11c\ub97c \uc0dd\uc131\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ub418\ub294 CLI \uc720\ud2f8\ub9ac\ud2f0\uc774\ub2e4. \\n\\n```bash\\n# \ub2e4\uc6b4\ub85c\ub4dc\\nwget -q --show-progress --https-only --timestamping \\\\\\n  https://pkg.cfssl.org/R1.2/cfssl_linux-amd64 \\\\\\n  https://pkg.cfssl.org/R1.2/cfssljson_linux-amd64\\n```\\n```bash\\n# cfssl, cfssljson \uc2e4\ud589 \uad8c\ud55c \ubd80\uc5ec\\nchmod +x cfssl_linux-amd64 cfssljson_linux-amd64\\n```\\n```bash\\n# cfssl \uc704\uce58 \ubcc0\uacbd\\nsudo mv cfssl_linux-amd64 /usr/local/bin/cfssl\\n```\\n```bash\\n# cfssljson \uc704\uce58 \ubcc0\uacbd\\nsudo mv cfssljson_linux-amd64 /usr/local/bin/cfssljson\\n```\\n\\n\uc81c\ub300\ub85c \uc124\uce58\ub418\uc5c8\ub294\uc9c0 \ud655\uc778\ud574\ubcfc\uae4c\uc694?!\\n```bash\\ncfssl version\\n\\n# \uacb0\uacfc\\nVersion: 1.2.0\\nRevision: dev\\nRuntime: go1.6\\n\\n\\ncfssljson --version\\n\\n# \uacb0\uacfc\\nflag provided but not defined: -version\\nUsage of cfssljson:\\n  -bare\\n        the response from CFSSL is not wrapped in the API standard response\\n  -f string\\n        JSON input (default \\"-\\")\\n  -stdout\\n        output the response instead of saving to a file\\n```\\ncfssljson \uc740 Version \uc815\ubcf4\ub294 \ub098\uc624\uc9c0 \uc54a\ub294 \uac83 \uac19\uc73c\ub098 \uc124\uce58\ub294 \uc798 \ub41c \uac83\uc73c\ub85c \ubcf4\uc790.\\n\\n## kubectl \uc124\uce58\\n```bash\\n# \ub2e4\uc6b4\ub85c\ub4dc\\nwget https://storage.googleapis.com/kubernetes-release/release/v1.8.0/bin/linux/amd64/kubectl\\n```\\n```bash\\n# \uc2e4\ud589\uad8c\ud55c \ubd80\uc5ec\\nchmod +x kubectl\\n```\\n```bash\\n# kubectl \uc704\uce58 \ubcc0\uacbd\\nsudo mv kubectl /usr/local/bin/\\n```\\n```bash\\nkubectl version --client\\n\\n# \uacb0\uacfc\\nClient Version: version.Info{Major:\\"1\\", Minor:\\"8\\", GitVersion:\\"v1.8.0\\", GitCommit:\\"6e937839ac04a38cac63e6a7a306c5d035fe7b0a\\", GitTreeState:\\"clean\\", BuildDate:\\"2017-09-28T22:57:57Z\\", GoVersion:\\"go1.8.3\\", Compiler:\\"gc\\", Platform:\\"linux/amd64\\"}\\n```"},{"id":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","metadata":{"permalink":"/en/blog/\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-05-\ub204\uc801\ub9e4\ucd9c\uad6c\ud558\uae30.md","source":"@site/blog/2024-01-05-\ub204\uc801\ub9e4\ucd9c\uad6c\ud558\uae30.md","title":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","description":"\uc544\ub798\uc640 \uac19\uc740 \uc8fc\ubb38 \ud14c\uc774\ube14\uc774 \uc788\ub2e4\uace0 \ud558\uc790.","date":"2024-01-05T00:00:00.000Z","formattedDate":"January 5, 2024","tags":[{"label":"sql","permalink":"/en/blog/tags/sql"},{"label":"sqld","permalink":"/en/blog/tags/sqld"}],"readingTime":3.835,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","title":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","authors":"junyeong","tags":["sql","sqld"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"kubernetes-the-hard-way (2)","permalink":"/en/blog/kubernetes-the-hard-way-2"},"nextItem":{"title":"giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","permalink":"/en/blog/giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30"}},"content":"\x3c!-- truncate --\x3e\\n\\n\\n\uc544\ub798\uc640 \uac19\uc740 \uc8fc\ubb38 \ud14c\uc774\ube14\uc774 \uc788\ub2e4\uace0 \ud558\uc790. \\n|\uc8fc\ubb38\ubc88\ud638|\uace0\uac1d\ubc88\ud638|\uc8fc\ubb38\uc77c\uc790|\uc8fc\ubb38\uae08\uc561|\\n|---|---|---|---|\\n|501|1|20190501|20000|\\n|612|1|20190523|5000|\\n|728|1|20200311|25000|\\n|904|1|20200715|10000|\\n|404|2|20191208|7000|\\n|603|2|20200428|6000|\\n|807|2|20200527|17000|\\n\\n``` sql\\nSELECT A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790, SUM(B.\uc8fc\ubb38\uae08\uc561) AS \uc8fc\ubb38\ud569\uacc4\uae08\uc561\\n  FROM \uc8fc\ubb38 A, \uc8fc\ubb38 B\\n WHERE B.\uace0\uac1d\ubc88\ud638 = A.\uace0\uac1d\ubc88\ud638\\n   AND B.\uc8fc\ubb38\uc77c\uc790 <= A.\uc8fc\ubb38\uc77c\uc790\\n GROUP BY A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790\\n ORDER BY A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790;\\n```\\n\\n\\n\\n\uc704\uc640 \uac19\uc774 \uc778\ub77c\uc778\ubdf0\ub97c \ud1b5\ud574\uc11c \ub204\uc801 \ub9e4\ucd9c\uc744 \uad6c\ud558\ub294 \ubc29\ubc95\uc774 \uc788\ub2e4. \uac19\uc740 \ud14c\uc774\ube14 \uac04\uc5d0 \uc870\uc778\uc744 \uc218\ud589\ud558\ub294 \uac83\uc744 \uc140\ud504 \uc870\uc778\uc774\ub77c\uace0 \ud558\ub294\ub370,\\n\uc704\uc758 \uacbd\uc6b0\ub294 2\uac1c\uc758 \uc870\uac74\uc744 \uc0ac\uc6a9\ud558\uc600\ub2e4. \ub2e8\uc21c\ud788 \uace0\uac1d\ubc88\ud638\ub85c\ub9cc \uc870\uc778\uc744 \ud558\uac8c \ub418\uba74 \uac19\uc740 \uace0\uac1d\ubc88\ud638 \ub0b4\uc5d0\uc11c \uc591\ucabd \uc9d1\ud569\uac04\uc5d0 \uce74\ud2f0\uc158 \uacf1\uc774 \ub9cc\ub4e4\uc5b4\uc9c0\uac8c \ub41c\ub2e4.\\n\uc774\ub54c A\ucabd\uc758 \uac01 \uc8fc\ubb38 \ub370\uc774\ud130 \uae30\uc900\uc73c\ub85c \uc8fc\ubb38\uc77c\uc790\uac00 \uc791\uac70\ub098 \uac19\uc740 B\ucabd \uc8fc\ubb38\uc744 \ubaa8\ub450 \uc120\ud0dd\ud558\ub3c4\ub85d \ud55c \uac83\uc774\ub2e4. \uc2e4\ud589 \uacb0\uacfc\ub97c \ubcf4\uc790.\\n\\n| \uace0\uac1d\ubc88\ud638 | \uc8fc\ubb38\uc77c\uc790 | \uc8fc\ubb38\ud569\uacc4\uae08\uc561 |\\n| :--- | :--- | :--- |\\n| 1 | 20190501 | 20000 |\\n| 1 | 20190523 | 25000 |\\n| 1 | 20200311 | 50000 |\\n| 1 | 20200715 | 60000 |\\n| 2 | 20191208 | 7000 |\\n| 2 | 20200428 | 13000 |\\n| 2 | 20200527 | 30000 |\\n\\n\\n\uc704\uc758 \ucffc\ub9ac\ub9cc\uc73c\ub85c\ub294 \uc8fc\ubb38\ud569\uacc4\uae08\uc561\uc774 \uc5b4\ub5a4\uc2dd\uc73c\ub85c \ub3c4\ucd9c\ub41c\uc9c0 \uc9c1\uad00\uc801\uc73c\ub85c \ud655\uc778\ud558\uae30 \uc5b4\ub835\ub2e4.\\nA\ud14c\uc774\ube14 (\uae30\uc900 \ud14c\uc774\ube14)\uc758 \uc8fc\ubb38\uae08\uc561\uc744 \ucd94\uac00\ud574\uc11c \ud655\uc778\ud574\ubcf4\ub3c4\ub85d \ud558\uc790.\\n``` sql\\nSELECT A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790, MIN(A.\uc8fc\ubb38\uae08\uc561) \uc8fc\ubb38\uae08\uc561, SUM(B.\uc8fc\ubb38\uae08\uc561) AS \uc8fc\ubb38\ud569\uacc4\uae08\uc561\\n  FROM \uc8fc\ubb38 A, \uc8fc\ubb38 B\\n WHERE B.\uace0\uac1d\ubc88\ud638 = A.\uace0\uac1d\ubc88\ud638\\n   AND B.\uc8fc\ubb38\uc77c\uc790 <= A.\uc8fc\ubb38\uc77c\uc790\\n GROUP BY A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790\\n ORDER BY A.\uace0\uac1d\ubc88\ud638, A.\uc8fc\ubb38\uc77c\uc790;\\n```\\n\uc704 \ucffc\ub9ac\uc758 \uc2e4\ud589\uacb0\uacfc\ub294 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n| \uace0\uac1d\ubc88\ud638 | \uc8fc\ubb38\uc77c\uc790 | \uc8fc\ubb38\uae08\uc561 | \uc8fc\ubb38\ud569\uacc4\uae08\uc561 |\\n| :--- | :--- | :--- | :--- |\\n| 1 | 20190501 | 20000 | 20000 |\\n| 1 | 20190523 | 5000 | 25000 |\\n| 1 | 20200311 | 25000 | 50000 |\\n| 1 | 20200715 | 10000 | 60000 |\\n| 2 | 20191208 | 7000 | 7000 |\\n| 2 | 20200428 | 6000 | 13000 |\\n| 2 | 20200527 | 17000 | 30000 |\\n\\n\uc704\uc758 \ud45c\uc5d0\uc11c \ud655\uc778\ud560 \uc218 \uc788\ub4ef\uc774 \ub450\ubc88\uc9f8 \ud589\uc778 \uc8fc\ubb38\uc77c\uc790 `20190523`\ud589\uc5d0\uc11c\ub294 `20,000 + 5,000 = 25,000` \uc73c\ub85c \uc8fc\ubb38\ud569\uacc4\uae08\uc561\uc774 \uc9d1\uacc4\ub418\ub294 \uac83\uc744 \ubcfc \uc218 \uc788\ub2e4.\\n\uadf8 \uc544\ub798\uc758 \ud589\ub3c4 \ub9c8\ucc2c\uac00\uc9c0\uc774\ub2e4.\\n\uc774\ud574\ub294 \uac00\uc9c0\ub9cc \uad73\uc774 \uc774\ub807\uac8c \uc140\ud504\uc870\uc778\uae4c\uc9c0 \uc0ac\uc6a9\ud558\uba74\uc11c \ub204\uc801\uac12\uc744 \uad6c\ud574\uc57c \ud558\ub294 \uac78\uae4c? \uc870\uae08 \ub354 \uadf8\ub7f4\ub4ef\ud558\uac8c \uc791\uc131\ud560 \uc218\ub294 \uc5c6\uc744\uae4c?\\n\ub2f5\uc740 `\uc708\ub3c4\uc6b0 \ud568\uc218`\uc5d0 \uc788\ub2e4.\\n```sql\\nSELECT\\n    \uace0\uac1d\ubc88\ud638, \uc8fc\ubb38\uc77c\uc790,\\n    SUM(\uc8fc\ubb38\uae08\uc561) OVER (PARTITION BY \uace0\uac1d\ubc88\ud638 ORDER BY \uace0\uac1d\ubc88\ud638, \uc8fc\ubb38\uc77c\uc790\\n        ROWS BETWEEN UNBOUNDED PRECEDING AND CURRENT ROW ) AS \uc8fc\ubb38\ud569\uacc4\uae08\uc561\\nFROM \uc8fc\ubb38;\\n```\\n\\n\uc5f0\uc2b5\ud558\uc790.\\n\\n\\n\\n\\n(SQLD \ud575\uc2ec\ub178\ud2b8, \ub514\ube44\uc548, p74~75)"},{"id":"giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","metadata":{"permalink":"/en/blog/giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-26-giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30.md","source":"@site/blog/2023-12-26-giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30.md","title":"giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","description":"\uc544\ub798 \uc2a4\ud06c\ub9b0\uc0f7 \ucc98\ub7fc initial \ud654\uba74\uc5d0\uc11c\ub294 giscus\uac00 \ubcf4\uc774\uc9c0 \uc54a\uace0 Load\ub97c \ud574\uc57c \ubcf4\uc774\ub294 \uacbd\uc6b0\uac00 \uc788\ub2e4.","date":"2023-12-26T00:00:00.000Z","formattedDate":"December 26, 2023","tags":[{"label":"tips","permalink":"/en/blog/tags/tips"}],"readingTime":0.45,"hasTruncateMarker":true,"authors":[{"name":"yeogoo","title":"\ube14\ub85c\uadf8 \uc8fc\uc778\uc7a5","url":"https://yeogoo.github.io","imageURL":"https://avatars.githubusercontent.com/u/48542008?v=4","key":"junyeong"}],"frontMatter":{"slug":"giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","title":"giscus \ud56d\uc0c1 \ubcf4\uc774\uac8c \ud558\uae30","authors":"junyeong","tags":["tips"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30","permalink":"/en/blog/\ub204\uc801\ub9e4\ucd9c \uad6c\ud558\uae30"}},"content":"\uc544\ub798 \uc2a4\ud06c\ub9b0\uc0f7 \ucc98\ub7fc initial \ud654\uba74\uc5d0\uc11c\ub294 giscus\uac00 \ubcf4\uc774\uc9c0 \uc54a\uace0 Load\ub97c \ud574\uc57c \ubcf4\uc774\ub294 \uacbd\uc6b0\uac00 \uc788\ub2e4.\\n![image](https://github.com/yjystyle/yjystyle.github.io/assets/48542008/59cf7feb-d18f-40f2-9f90-ea3e898da351)\\n\\n\x3c!-- truncate --\x3e\\n\\n`components/Comments.tsx` \uc5d0\uc11c `useState(true)`\ub85c \ubcc0\uacbd\ud574\uc8fc\uba74 \ub41c\ub2e4.\\n```javascript\\nexport default function Comments({ slug }: { slug: string }) {\\n  const [loadComments, setLoadComments] = useState(true)\\n  return (\\n    <>\\n      {!loadComments && <button onClick={() => setLoadComments(true)}>Load Comments</button>}\\n      {siteMetadata.comments && loadComments && (\\n        <CommentsComponent commentsConfig={siteMetadata.comments} slug={slug} />\\n      )}\\n    </>\\n  )\\n}\\n```"}]}')}}]);